                  </div>
                  </div>
              </div>
  
              <div className="col-12 col-md-6 col-lg-4">
              <div className="d-flex gap-3 ">
                      <img src="../images/illustration/beaker.png" alt="" className="img-fluid h-25"/>
                  <div>
                      <h6>ADVANCED</h6>
                      <p className="para">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua</p>
                  </div>
                  </div>
              </div>
  
              <div className="col-12 col-md-6 col-lg-4">
              <div className="d-flex gap-3 ">
                      <img src="../images/illustration/physics.png" alt="" className="img-fluid h-25 "/>
