                              <img src="../images/illustration/twitter.png" alt="" />
                              <img src="../images/illustration/google-plus.png" alt="" />
                              <img src="../images/illustration/linkedin.png" alt="" />
                          </div>
                          </FigureCaption>
                      </div>
                  </figure>
  
                  <figure className="col-md  col-lg text-center container mt-2">
                      <div className="container border border-2">
                      <img src="../images/illustration/team-06.jpg" alt="" className="img-fluid"/>
  
                          <FigureCaption>
                              <h2>Alex Pattern</h2>
